'use strict';

let songNames = ["Single Phial.mp3", "Discovering.mp3", "Dawn.mp3"]; //rename to correct ones

export function applyUserProperties(changedUserProperties)
{
    if (changedUserProperties.music != undefined)
    {
        if (+changedUserProperties.music != 0)
        {
            for (let i = 0; i < songNames.length; i++)
            {
                if (i != +changedUserProperties.music-1) songNames[i].stop();
            }
            if (!songNames[+changedUserProperties.music-1].isPlaying())
            {
                songNames[+changedUserProperties.music-1].play();
            }
        }
        else
        {
            songNames.forEach(song => song.stop());
        }
    }
}

export function init()
{
    songNames = songNames.map(song => thisScene.getLayer(song));
    songNames.forEach(song => song.stop());
}

